import React from "react";

const customer = [
	{ name: "one", phoneNumber: "1238654" },
	{ name: "two", phoneNumber: "1234434" },
	{ name: "three", phoneNumber: "34854354" },
	{ name: "five", phoneNumber: "874365345" },
];

const Customer = () => {
	return <div>customer</div>;
};

export default Customer;
